import React, { Component } from "react";
import { Row, Col } from "antd";

export default class Intro extends Component {
  render() {
    return (
      <>
      <div style={{width:"100%"}}>
        <Row type="flex" justify="center" align="middle">
          <Row>
            <Col>
              <h1 style={{ fontFamily: "Poppins"}}>
                DL 1961
              </h1>
            </Col>
          </Row>
        </Row>
        <Row
          type="flex"
          justify="center"
          align="middle"
          style={{
            flexDirection: "column",
          }}
        >
     
        </Row>
        </div>
      </>
    );
  }
}
